# AMD64 (64-bit) Linux/SuSE Pathscale v2.3 config file 
# Config file for CPU2006
#####################################################################

ignore_errors = yes
tune          = base
ext           = gcc44
output_format = asc,html
teeout        = yes
teerunout     = yes

default=default=default=default:
#####################################################################
# Compiler selection
#
#
#CC           = gcc.orig -fno-strict-aliasing -static
#CXX          = g++.orig -fno-strict-aliasing -static
CC           = gcc -fno-strict-aliasing -static -g
CXX          = g++ -fno-strict-aliasing -static -g
FC           = openf90 -m32 -gnu4 -static
#FLD = pathf90 
#F77LD = pathf90

#####################################################################
# Optimization
#####################################################################
default=peak=default=default:
COPTIMIZE    = -O2 
CXXOPTIMIZE  = -O2
FOPTIMIZE    = -O2

notes0100= C/C++ peak flags:
notes0110= Fortran peak flags:

default=base=default=default:
COPTIMIZE    = -O2
CXXOPTIMIZE  = -O2
FOPTIMIZE    = -O2


notes0100= C/C++ base flags:
notes0110= Fortran base flags:

